html {
  width: 100%;
  height: 100%;
  margin: 0;
  padding: 0;
}

@media (max-width: 1215px) {
  #root {
    width: 100%;
    height: 100%;
  }
}

body {
  background: #07004e;
  background-size: 200% 200%;
  width: 1200;
  margin: 0px;
  display: flex;
  align-items: center;
  flex-direction: column;
  font-family: "Red Hat Mono", monospace;
  color: #efefef;
  background-attachment: fixed;
}

@keyframes background {
  0% {
    background-position: 0% 50%;
  }
  50% {
    background-position: 100% 50%;
  }
  100% {
    background-position: 0% 50%;
  }
}
h3 {
  color: #efefef;
  font-size: 36px;
  font-family: "Red Hat Mono", monospace;
  font-weight: 400;
  text-align: center;
}

ul {
  list-style: none;
  padding: 0;
  width: 400px;
}

/* Overlay Styles */
.overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgb(7, 0, 78);
  color: white;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  z-index: 1000;
}

/* Transition Styles */
.overlay-transition-enter {
  transform: translateY(-100%);
}

.overlay-transition-enter-active {
  transform: translateY(0);
  transition: transform 2500ms;
}

.overlay-transition-exit {
  transform: translateY(0);
}

.overlay-transition-exit-active {
  transform: translateY(-100%);
  transition: transform 2500ms;
}

#landingAndSticky {
  margin-top: 200px;
  position: sticky;
  display: flex;
  flex-direction: column;
  align-items: center;
  align-content: flex-start;
  text-align: center;
  justify-content: flex-start;
  top: 0px;
  z-index: 10;
  height: 100vh;
  margin-bottom: 50px;
}
#landingAndSticky h1 {
  font-size: 84px;
  margin: 0px 20px;
  font-family: "Rubik", sans-serif;
}

.favoriteMusicHeader {
  display: flex;
  align-items: center;
  margin-bottom: 50px;
}
.favoriteMusicHeader h1 {
  margin: 0px 20px;
}

.graphWrapper {
  margin: auto;
  display: flex;
  flex-direction: column;
  justify-content: center;
}
.graphWrapper h3 {
  margin-left: 60px;
  margin-top: 100px;
  margin-bottom: 10px;
  text-align: start;
  text-transform: uppercase;
}

.sliderContainer {
  display: flex;
  flex-direction: column;
  align-items: center;
}

.sliderSubContainer {
  background: -webkit-linear-gradient(60deg, #B200FF, #0085FF, #0BEC21);
  -webkit-background-clip: text;
  background-clip: text;
  -webkit-text-fill-color: transparent;
  font-size: 74px;
  margin: 0px;
}

.slider {
  --webkit-appearance: none;
  appearance: none;
  width: 700px;
  height: 5px;
  margin: 20px 0px;
  border-radius: 69px;
  background: -webkit-linear-gradient(60deg, #B200FF, #0085FF, #0BEC21);
  opacity: 0.7;
  -webkit-transition: 0.2s;
  transition: 0.2s;
}
.slider:hover {
  opacity: 1;
}

.slider::-webkit-slider-thumb {
  -webkit-appearance: none;
  appearance: none;
  width: 25px;
  height: 25px;
  background-image: url(http://localhost:8000/backtrack_green.png);
  background-repeat: no-repeat;
  background-size: contain;
  cursor: pointer;
}

.slider::-moz-range-thumb {
  width: 25px;
  height: 25px;
  cursor: pointer;
}

.chart {
  flex: 2;
}

.barStyle {
  fill: #04a8b4;
}
.barStyle:hover {
  fill: #04a8b4;
}
.barStyle.recharts-bar-active {
  fill: transparent !important;
}

.custom-tooltip {
  margin: "0px 40px 100px 500px";
  background: "#04a8b4";
  width: "300px";
  height: "400px";
  padding: "20px";
  display: "flex";
  flex-direction: "column";
  justify-content: "flex-start";
  align-items: "center";
}

.navBar {
  display: flex;
  justify-content: center;
}
.navBar img {
  margin: 25px;
  height: 50px;
}
@media (max-width: 950px) {
  .navBar + h3 {
    font-size: 30px;
  }
}

.gradientHeader {
  background: -webkit-linear-gradient(60deg, #B200FF, #0085FF, #0BEC21);
  -webkit-background-clip: text;
  background-clip: text;
  -webkit-text-fill-color: transparent;
  font-family: "Red Hat Mono", monospace;
  font-size: 64px;
  text-align: center;
}
@media (max-width: 1215px) {
  .gradientHeader {
    font-size: 50px;
  }
}
@media (max-width: 950px) {
  .gradientHeader {
    font-size: 40px;
  }
}

.TopTracksAndImageContainer {
  display: flex;
  justify-content: center;
  gap: 15%;
  align-items: center;
  margin-bottom: 100px;
}
@media (max-width: 1055px) {
  .TopTracksAndImageContainer {
    flex-direction: column;
    align-items: center;
  }
}

.TopTracksContainer {
  width: 422px;
}
.TopTracksContainer h3 {
  margin: 0px;
  text-align: left;
}
@media (max-width: 1055px) {
  .TopTracksContainer h3 {
    text-align: center;
  }
}

.TopTracksContainer li {
  border: 0.3px solid rgba(255, 255, 255, 0.7);
  display: flex;
  width: 400px;
  height: 20px;
  padding: 10px;
  margin: 10px 0px;
  border-radius: 69px;
  white-space: nowrap;
  overflow: hidden;
  cursor: pointer;
}
.TopTracksContainer li img {
  height: 15px;
  width: 15px;
  margin: 0px 10px;
}

.trackScrollWrapper {
  width: 100%;
  position: relative;
  overflow: hidden;
}

.tracks {
  position: absolute;
  overflow: hidden;
  display: block;
  width: 100%;
}
.tracks div {
  display: inline-block;
  width: 50%;
}

@keyframes marquee {
  0% {
    left: 0;
  }
  100% {
    left: -100%;
  }
}
.onPlay {
  position: absolute;
  overflow: hidden;
  display: block;
  width: 200%;
  animation: marquee 8s linear infinite;
}
.onPlay div {
  display: inline-block;
  width: 50%;
}

.trackImage h3 {
  margin: 0;
  text-align: end;
  margin-bottom: 15px;
}
@media (max-width: 1055px) {
  .trackImage h3 {
    text-align: center;
  }
}

.trackImageCard {
  background: linear-gradient(#ADADFF, #6072D1);
  width: 500px;
  height: 515px;
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
}
.trackImageCard img {
  padding-top: 25px;
  height: 400px;
  width: 425px;
  object-fit: cover;
}
.trackImageCard h4 {
  font-weight: 300;
  text-align: end;
  margin-right: -250px;
}

.topAlbum h3 {
  margin: 0;
  text-align: end;
  word-wrap: break-word;
  margin-bottom: 15px;
}
@media (max-width: 1055px) {
  .topAlbum h3 {
    text-align: center;
  }
}

.albumCard {
  background: rgb(0, 133, 255);
  background: linear-gradient(16deg, rgba(238, 0, 255, 0.2) 0%, rgb(0, 133, 255) 100%);
  width: 500px;
  height: 515px;
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
}
.albumCard img {
  padding-top: 25px;
  height: 400px;
  width: 425px;
  object-fit: cover;
}
.albumCard h4 {
  font-weight: 300;
  text-align: end;
  margin-right: -250px;
}

.artistsWrapper {
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
.artistsWrapper h3 {
  font-family: "Rubik", sans-serif;
  font-weight: 800;
  margin-top: 1em;
  margin-bottom: 1em;
  font-size: 60px;
  background: #efefef;
  -webkit-background-clip: text;
  background-clip: text;
  -webkit-text-fill-color: transparent;
}

.artists {
  width: 60%;
  height: 40%;
  margin-bottom: 3em;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  gap: 2em;
}

.artists p {
  font-family: "Roboto Mono", monospace;
  font-size: 30px;
  color: #efefef;
}

.topAlbumsDisplay {
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
}
.topAlbumsDisplay h3 {
  font-family: "Rubik", sans-serif;
  font-size: 60px;
  font-weight: 700;
  line-height: 76px;
  background: #efefef;
  text-align: center;
  -webkit-background-clip: text;
  background-clip: text;
  -webkit-text-fill-color: transparent;
  margin-top: 3em;
}

.albumContainer {
  background: linear-gradient(#ADADFF, #6072D1);
  width: 800px;
